.globl main
main:
	# Load level count into $t1
	lw $t1, level_count
	
	# Initialize $s0 and $s1 with base and max address respectively
	li $s0, BASE_ADDRESS
	li $s1, MAX_ADDRESS
	
	# Load the address of player_pos into $s3 and store 54848 in it
	la $s3, player_pos
	li $t0, 54848   
	sw $t0, 0($s3) 
	
	# Move $s0 (base address) into $a0
	move $a0, $s0

	# Check the level count and branch to the appropriate level or end game
	beq $t1, 2, level2
	beq $t1, 3, level3
	beq $t1, 4, end_game
	
	# If the level count is not 2, 3, or 4, load the address of hex_vals into $s2
	la $s2, hex_vals
	# Move $s2 (address of hex_vals) into $a1
	move $a1, $s2
	
	# Jump to paint_home_screen
	j paint_home_screen

end_game:
	# Load the value of player_health into $t2
	lw $t2, player_health
	# Branch if $t2 is greater than 0 to player_won
	bgt $t2, 0, player_won
	# Jump to endLevel
	j endLevel
	
player_won:
	# Store the value 56576 in player_pos
	li $t0, 56576 
	sw $t0, 0($s3)
	
	# Set the level_count to 4
	li $t2, 4
	sw $t2, level_count
	
	# Move $s0 (base address) into $a0
	move $a0, $s0
	
	# Load the address of game_win into $s2
	la $s2, game_win
	
	# Move $s2 (address of game_win) into $a1
	move $a1, $s2
	
	# Store 0 in player_state
	li $t1, 0x00
	sw  $t1,  player_state
	
	# Jump to paint_landscape
	j paint_landscape


level2: 
	# Store the value 56352 in player_pos
	li $t0, 56352    
	sw $t0, 0($s3) 
	
	# Move $s0 (base address) into $a0
	move $a0, $s0
	
	# Load the address of level_2 into $s2
	la $s2, level_2
	
	# Move $s2 (address of level_2) into $a1
	move $a1, $s2
	
	# Jump to paint_landscape
	j paint_landscape
	
level3:
	# Store the value 56576 in player_pos
	li $t0, 56576   
	sw $t0, 0($s3) 
	
	# Move $s0 (base address) into $a0
	move $a0, $s0
	
	# Load the address of level_3 into $s2
	la $s2, level_3
	
	# Move $s2 (address of level_3) into $a1
	move $a1, $s2
	
	# Jump to paint_landscape
	j paint_landscape

endLevel:
	# Store the value 56576 in player_pos
	li $t0, 56576   
	sw $t0, 0($s3) 
	
	# Set the level_count to 4
	li $t2, 4
	sw $t2, level_count
	
	# Move $s0 (base address) into $a0
	move $a0, $s0
	
	# Load the address of game_over into $s2
	la $s2, game_over
	
	# Move $s2 (address of game_over) into $a1
	move $a1, $s2
	
	# Store 0 in player_state
	li $t1, 0x00
	sw  $t1,  player_state
	
	# Jump to paint_landscape
	j paint_landscape
    
paint_home_screen:
	#if its done painting, jump to wait_for_enter to start the game
	bge $a0, $s1, wait_for_enter
	
	#set all the values to their default for painting the level
	lw $t0, ($a1)
 	sw $t0, ($a0)     
 	addi $a0, $a0, 4    
 	addi $a1, $a1, 4
	#jump to the paint_home_screen function if the balue in $a0 < $s1
 	j paint_home_screen 
 
 wait_for_enter:
 	#wait for the user to click enter to start the game
	li $t1, 0xffff0000
	lw $t2, 4($t1)
	beq $t2, 0x0A, paint_landscape
	j waiting_for_command
 
 
waiting_for_command:
	#if a key is pressed
	li $t1, 0xffff0000
	lw $t2, ($t1)
	lw $t3, player_state
	#load level_1 in the beginning
	la $s2, level_1
	lw $t4, level_count
	move $a1, $s2
	move $a0, $s0
	#if there was an input detected
	beq $t2, 1, read_input
	
	#if nothing is entered, then we continue in the direction that was pressed
	beq $t3, 0x61, move_left # 'a' is pressed
	beq $t3, 0x64, move_right # 'd' is pressed
	beq $t3, 0x77, move_up # 'w' is pressed
	beq $t3, 0x73, cancel_jump # 's' is pressed
	
	# jump to waiting_for_command
	j waiting_for_command

