double_jump:
	lw $t1, player_pos   # Load the player position into $t1
	add $a1, $s0, $t1   # Add player position to $s0 and store in $a1

addi $a1, $a1, 1532 # Add 1532 to $a1
lw $t0, ($a1)       # Load the word at memory address $a1 into $t0

beq $t0, $zero, left_wall   # If $t0 is 0, branch to label 'left_wall'

addi $a1, $a1, 552  # Add 552 to $a1
lw $t0, ($a1)       # Load the word at memory address $a1 into $t0

beq $t0, $zero, right_wall  # If $t0 is 0, branch to label 'right_wall'

beq $t3, 0x77, activate_double_jump # If $t3 is equal to 0x77, branch to label 'activate_double_jump'

j waiting_for_command # Unconditionally jump to label 'waiting_for_command'
	

activate_double_jump:

	#load the value of player_double_jump	
	lw $t2, player_double_jump
	#if double jump is already activated, then skip to waiting_for_command
	beq $t2, 1, waiting_for_command
	#add 60 to the player_jump_count
	lw $t4, player_jump_count
	addi $t4, $t4, 60
	#save the value to player_jump_count
	sw $t4, player_jump_count
	#jump to apply_gravity
	j apply_gravity

	#if the player is jumping on left wall
	left_wall:
		lw $t4, player_jump_count
		addi $t4, $t4, 60
		sw $t4, player_jump_count
		li $t3, 0x64
		sw $t3, player_state
	j move_up
	
	#if the player is jumping on right wall
	right_wall:
		lw $t4, player_jump_count
		addi $t4, $t4, 60
		sw $t4, player_jump_count
		li $t3, 0x61
		sw $t3, player_state
	j move_up

	#read the input from the user and branch to corresponding functions
read_input:

	lw $t3, player_state
	lw $t2, 4($t1) 
	beq $t3, $t2, double_jump
	
	sw $t2, player_state
	beq $t2, 0x0A, paint_landscape
	beq $t2, 0x70, reset_values
	
	beq $t2, 0x61, move_left # 'a' is pressed
	beq $t2, 0x64, move_right # 'd' is pressed
	beq $t2, 0x77, move_up_pre # 'w' is pressed
	beq $t2, 0x73, cancel_jump # 's' is pressed
	j waiting_for_command #anything else is pressed
	
	#if the character is touching an object above them, then cancel the jump and reset the value of player_jump_count to 0
cancel_jump:

	li $t2, 0
	sw $t2, player_jump_count
	li $v0, 32
	li $a0, 35
	syscall
	j apply_gravity
	
	#intially set the value of jumping to 60
move_up_pre:
	li $t2, 60
	sw $t2, player_jump_count
	j move_up
	
	#paint the landscape of any given level, and the lives
paint_landscape:
	blt $a0, $s1, continue_painting
	
	lw $t1, level_count
	beq $t1, 4, reset_values
	
	lw $t2, player_health
	beq $t2, 3, life3
	beq $t2, 2, life2
	beq $t2, 1, life1
	j reset_values
	
	#reset the values of health and the level when the player wants to restart
reset_values:
	li $t5, 1
	sw $t5, level_count
	
	li $t4, 3
	sw $t4, player_health
	
	li $v0, 32
	li $a0, 5000
	syscall
	
	j main

#continue paiting the landscape if the value of the counter pixel is not the max address
continue_painting:
	lw $t0, ($a1)
	sw $t0, ($a0)
	addi $a0, $a0, 4
	addi $a1, $a1, 4
	blt $a0, $s1, continue_painting
	j paint_landscape

#paint the player, depending on whether its travelling up/down/left/right
paint_player:
	lw $t2, player_state
	beq $t2, 0x77, animate_up #up
	beq $t2, 0x73, animate_down #up
	j animate
	
	
